import React, { Component } from 'react';
import { Link } from 'react-router-dom';


class Filters extends Component {
  render() {
    return( 
    <div>
        <div>
          <h6>Название</h6>
        </div>
          <select class="form-select" aria-label="Default select example">
            <option selected></option>
            {this.props.data.map((item, i)=>{
        return (
            <option>{item.name}</option>
        )})}
        </select>
       
        <div>
          <h6>Группа</h6>
        </div>
        <input class="form-check-input" type="radio" name="gridRadios" id="radio1" value="Поставщик" checked/>
        <input class="form-check-input" type="radio" name="gridRadios" id="radio2" value="Клиент" checked/>
        <input class="form-check-input" type="radio" name="gridRadios" id="radio3" value="Клиент, поставщик" checked/>
    </div>
    )
  }
}

export default Filters;
